<template>
  <div class="login-container">
    <div class="login-card">
      <h2 class="login-title">GOFIT Fitness Center</h2>
      <div v-if="loginFailed" class="alert alert-danger">
        Email atau Password Anda salah.
      </div>
      <form @submit.prevent="login">
        <div class="form-group">
          <label for="email">Email</label>
          <input type="email" v-model="user.email" class="form-control" placeholder="Email">
        </div>
        <div class="form-group">
          <label for="password">Password</label>
          <input type="password" v-model="user.password" class="form-control" placeholder="Password">
        </div>
        <button type="submit" class="login-button">Login</button>
      </form>
      <div class="login-info-card">
        <div class="login-info">
          <p style="text-align: center;">Password Default Adalah tanggal Lahir (dd/mm/yyyy)</p>
          <p style="text-align: center;">Hubungi Admin Jika Perlu Bantuan</p>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
  import {
    reactive,
    ref
  } from 'vue'
  import {
    useRouter
  } from 'vue-router'
  import axios from 'axios'
  import {
    useToast
  } from "vue-toastification";

  export default {

    setup() {

      //inisialisasi vue router on Composition API
      const router = useRouter()

      //state user
      const user = reactive({
        email: '',
        password: '',
      })

      //state validation
      const validation = ref([])

      //state loginFailed
      const loginFailed = ref(null)

      let toast = useToast();

      //method login
      function login() {
        //send server with axios
        axios
          .post("https://200710569.gofit.backend.given.website/api/login", user)
          .then((response) => {
            if (response.data.user.id_pegawai !== null) {
              if (response.data.success) {
                toast.success("Berhasil Login !", {
                  timeout: 2000
                })
                //set token
                localStorage.setItem("id", response.data.user.id);
                localStorage.setItem("id_pegawai", response.data.user.id_pegawai);
                localStorage.setItem("token", response.data.access_token);
                
                // Fetch 'role' from the server based on the logged-in 'id_pegawai'
                axios
                  .get(`https://200710569.gofit.backend.given.website/api/pegawaiRole/${response.data.user.id_pegawai}`)
                  .then((response) => {
                    console.log(response.data)
                    // Store the 'role' attribute in local storage
                    localStorage.setItem("role", response.data.data);
                  })
                  .catch((error) => {
                    // Handle error when fetching 'role' from the server
                    console.log(error);
                  });

                //redirect ke halaman dashboard
                router
                  .push({
                    name: "welcome",
                  })
              }
            } else {
              toast.error("Email Pegawai Tidak Terdaftar!", {
                timeout: 2000
              })
            }
          })
          .catch((error) => {
            loginFailed.value = true
            //set validation dari error response
            validation.value = error.response.data;
          });
      }

      return {
        user, // <-- state user
        validation, // <-- state validation 
        loginFailed, // <-- state loggedIn
        login // <-- method login
      }

    }

  }
</script>

